import React from 'react';

class Test extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          fur: true,
          question: 1,
          pet: "dog",
          email: "tranqvilier@gmail.com",
          name: "Sol"
      };
        //this.changeQuestion = this.changeQuestion.bind(this);
        //this.changeFur = this.changeFur.bind(this);
        //this.changePet = this.changePet.bind(this);
        //this.changeMail = this.changeMail.bind(this);
        //this.changeName = this.changeName.bind(this);
      }
    render(){
        return (
        <form method="post" action="http://server1">
            <p>Do you like warm and fuzzy pets?</p>
            <input type="radio" id="fuzzy" name="fuzzy" value="fuzzy"
         checked/>
            <label for="fuzzy">Yes</label>
            <input type="radio" id="nofuz" name="nofuz" value="nofuz"
         checked/>
            <label for="cat">No</label>
            <p>What kind?</p>
            <input type="radio" id="dog" name="dog" value="dog"
         checked/>
            <label for="fuzzy">Dogs</label>
            <input type="radio" id="hams" name="hams" value="hams"
         checked/>
            <label for="notfuzzy">Hamsters</label>
            <input type="radio" id="cat" name="cat" value="cat"
         checked/>
            <label for="cat">Cats</label>
            <p>What kind?</p>
            <p>Enter your name:</p>
            <input type="text" name="name"/>
            <br/>
            <p>Enter your email:</p>
            <input type="text" name="email"/>
            <br/>
            <input type="submit" value="Submit"/>
        </form> );
    }
};

export default Test;
